from typing import List

class Solution:
    def beautifulIndices(self, s: str, a: str, b: str, k: int) -> List[int]:
        def findAllSubstrIndices(haystack: str, needle: str) -> List[int]:
            return [i for i in range(len(haystack) - len(needle) + 1) if haystack[i:i+len(needle)] == needle]

        a_indices = findAllSubstrIndices(s, a)
        b_indices = findAllSubstrIndices(s, b)
        beautiful_indices = []

        for i in a_indices:
            if any(abs(i - j) <= k for j in b_indices):
                beautiful_indices.append(i)

        return sorted(beautiful_indices)
